import React from 'react'; // we need this to make JSX compile
import { NavigationData } from './NavigationData';


const Navigation = () => {
    return (
        <div>
        {NavigationData.map((item) => {
            return (
                <div>{item.title}</div>
            )
        })}
        </div>
    )
}

export default Navigation
